import '../css/App.css';
import '../images/open-ai.png';
import PetNames from './PetNames';
import ImageGenerator from './ImageGenerator';
import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

function useQuery() {
  const { search } = useLocation();

  return React.useMemo(() => new URLSearchParams(search), [search]);
}


function App() {
  const logo = require('../images/open-ai.png');
  let query = useQuery();

  return (
    <div className="App">
      <header className="App-header">
        <div className="container-header">
          <div className="logo-open-ai">
            <img src={logo} width="40" />
          </div>
          <div className="menu-header">
            <ul>
              <li><a href='/?page=pet-names'>NLP</a></li>
              <li><a href='/?page=generate-images'>Computer Vision</a></li>
            </ul>
          </div>
        </div>
      </header>

      <div className="main">
        <PetNames></PetNames>
        <ImageGenerator></ImageGenerator>
      </div>
    </div>
  );
}

export default App;
